import React from 'react';
import Proptypes from 'prop-types'
import 'antd/dist/antd.css'

const App = ({ Component }) => {
  return (
    <Component />
  )
}

App.propTypes = {
  Component: Proptypes.elementType.isRequired,
}

export default App;

// _app.js 는 index.js, profile.js, signup.js 등 js 파일들의 공통 적인 부분을 담당한다.
// _app.js 의 App() 에 들어가는 { Component } 에 js 파일의 return 되는 부분이 들어가고 그것이 <Component /> 가 된다.
